import React from 'react';
import { Navbar, NavbarBrand } from 'react-bootstrap';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav'
import {
  BrowserRouter as Router,
  Route,
  Link,
  BrowserRouter
} from "react-router-dom";
import './App.css';

import Footer from './Components/Footer';
import HomePage from './Pages/HomePage';
import AboutPage from './Pages/AboutPage';
import ContactPage from './Pages/ContactPage';

class App extends React.Component {

  constructor(props){
    super(props);
    this.state = {
      title: 'Jamil Naber',
      headerLinks : [
        {title: 'Home', path: '/Protfolio-Site/' },
        {title: 'About', path: '/Protfolio-Site/about' },
        {title: 'Contact', path: '/Protfolio-Site/contact' }
      ],
      home: {
        title: 'Welcome ',
        subTitle: 'Summarization of my life',
        text: 'Take a look at my projects' 
      },
      about: {
        title: 'About me '
      },
      contact: {
        title: 'Message Me'
      }
    }
  }

  render(){
    return (
        <Router>
          <Container className="p-0" fluid={true}>
            <Navbar className="border-bottom" bg="transparent" expand="lg">
              <Navbar.Brand>Jamil Naber</Navbar.Brand>
              <Navbar.Toggle className="border-0" aria-controls="navbar-toggle"/>
              <Navbar.Collapse id="navbar-toggle">
                <Nav className="ml-auto">
                  <Link className="nav-link" to="/Protfolio-Site/">Home</Link>
                  <Link className="nav-link" to="/Protfolio-Site/about">About</Link>
                  <Link className="nav-link" to="/Protfolio-Site/contact">Contact</Link>
                </Nav>
              </Navbar.Collapse>
            </Navbar>

            {/* <BrowserRouter basename={window.location.pathname || ''}>
            </BrowserRouter> */}
              <Route path='/Protfolio-Site/' exact render={() => <HomePage title={this.state.home.title} subTitle={this.state.home.subTitle} text={this.state.home.text}/>} />
              <Route path='/Protfolio-Site/about' exact render={() => <AboutPage title={this.state.about.title} />} />
              <Route path='/Protfolio-Site/contact' exact render={() => <ContactPage title={this.state.contact.title} />} />

            <Footer />

          </Container>
        </Router>
      );
  }
}

export default App;
